def get_answer(body):
    zero(100)
    strlen=0
    lastspace=0
    lastd=-1
    d=0
    s=0
    argn=0
    ln=len(body)
    if ln>90:
        return "Cлишком большое сообщение(\nПопробуй его разделить на несколько"
    while d<ln:
        w=body[d]
        if w==" ":
            if s-lastspace>84:
                zero(s)
                return "Разделяй большие слова пробелами('"+ body[lastd+1:d]+"'),чтобы их было проще обрабатывать"
            if strlen>84:
                paint("\n",lastspace)

                strlen=s-lastspace
                lastspace = s
                s+=paint(" ",s)
            else:
                lastspace=s
                g=paint(w,s)
                s+=g
                strlen+=g
            lastd=d
        else:
            g=paint(w,s)
            s+=g
            strlen+=g
            argn+=g
        if w=="\n":
            strlen=0
            lastspace=s
            argn-=2
        d+=1
    if body[0]=='4' and body[1]=='2':
        return goprintsmall(s-2)
    ll=goprint(s)
    if argn:
        return ll
    return ""

